import React, {useState, useEffect} from 'react'

const TestPage = () => {
  let [messages, setMessages] = useState([])
  return (
    <div>
      <h1>You are logged in! poggers</h1>
      
      <ul>
        {messages.map(message => (
            <li key={message.id}>{message.body}</li>
        ))}
      </ul>

    </div>
  )
}

export default TestPage
